import { Route, Routes } from "react-router-dom";
import React from "react";
import Registration from "../Auth/Registration";

function Router() {
  return (
    <>
        <Routes>
            <Route exact path="/" component={<Registration />} />
        </Routes>   
    </>
  );
}

export default Router;
